import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the search input using placeholder attribute (different selector)
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });

    // Type 'iPhone' into the search input
    await page.fill('input[placeholder="Search Amazon"]', 'iPhone');

    // Take screenshot after typing
    const step2 = path.join(screenshotsDir, 'step_2_typed_iphone.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Wait for the search button using nth-of-type (since there are multiple .search-btn)
    const searchBtnSelector = '(//button[contains(@class,"search-btn")])[1]';
    await page.waitForSelector(searchBtnSelector, { timeout: 5000 });

    // Click the search button
    await page.click(searchBtnSelector);

    // Wait for results header to appear (search results are rendered in mainContent)
    await page.waitForSelector('h2:has-text("Search Results")', { timeout: 5000 });

    // Take screenshot of results
    const step3 = path.join(screenshotsDir, 'step_3_results.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract product titles containing 'iPhone'
    const productTitles = await page.$$eval('.product-title', nodes =>
      nodes.map(n => n.textContent).filter(t => t && t.toLowerCase().includes('iphone'))
    );

    return {
      success: true,
      action: "Searched for 'iPhone' products and extracted matching product titles",
      extractedData: {
        productTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
